   }




  return (
     <Router>
    <div className="App">
      <Heading />
      <h1>{counter}</h1>
      <button onClick={increase}>Click</button>
      <Switch>
      <Route path="/" exact component={Home}/>
      <Route path="/appointment"component={Appointment}/>
